import './ExpenseItem.css'

function ExpenseItem() {
    //always we should have one root element()
    return(
    <div>
        <div>Nov 4th 2022</div>
        <div>
            <h2>
                LG TV
            </h2>
            </div>
            <div>
                $21.22
            </div>
       
    </div>
    )
}
export default ExpenseItem;
